import { CCol, CContainer, CRow } from "@coreui/react";
import { useSelector } from "react-redux";
import classes from "./EditOrder.module.css";
const EditOrder = () => {
  const mapStateToProps = (state) => {
    return {
      data: state.shopStore.singleOrderData.data,
    };
  };
  const state = useSelector(mapStateToProps);

  return (
    <CContainer>
      <CRow>
        <CRow>
          <CCol
            md={8}
            sm={12}
            style={{ backgroundColor: "green", width: "100%" }}
          >
            {/* sfsdffsfsfsfsfsdfsfsfsddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd
            ddddddddddddddddddddddddddddddddddddddddddddddddddd */}
          </CCol>
          <CCol md={4} sm={12} style={{ width: "100%" }}>
            <div className={classes.note}>
              Please leave the product outsite the house
            </div>
          </CCol>
        </CRow>
      </CRow>
    </CContainer>
  );
};
export default EditOrder;
